// /frontend/components/AddUser.js
import React, { useState } from 'react';
import { addSampleDetails } from '../API/Api';

const AddSampleDetails = () => {
  const [articleName, setArticleName] = useState('');
  const [designFileNo, setDesignFileNo] = useState('');
  const [seriesArticleFileNo, setSeriesArticleFileNo] = useState('');
  const [articleType, setArticleType] = useState('');
  const [gender, setGender] = useState('');
  const [machineSpeed, setMachineSpeed] = useState('');
  const [designer, setDesigner] = useState('');
  const [grapher, setGrapher] = useState('');
  const [master, setMaster] = useState('');
  const [sampleStatus, setSampleStatus] = useState('');
  const [message, setMessage] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = { articleName, designFileNo, seriesArticleFileNo, articleType, gender, machineSpeed, designer, grapher, master, sampleStatus};
console.log(data);
    try {
      const result = await addSampleDetails(data);
      setMessage(result.message);
    } catch (error) {
      setMessage(error.message);
    }
  };

  return (
    <div>
      <h2>Add Sample Details</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Article Name:</label>
          <input type="text" value={articleName} onChange={(e) => setArticleName(e.target.value)} required />
        </div>
        <div>
          <label>Design File Number:</label>
          <input type="text" value={designFileNo} onChange={(e) => setDesignFileNo(e.target.value)} required />
        </div>
        <div>
          <label>Series Article File No:</label>
          <input type="text" value={seriesArticleFileNo} onChange={(e) => setSeriesArticleFileNo(e.target.value)} required />
        </div>
        <div>
          <label>Article Type:</label>
          <input type="text" value={articleType} onChange={(e) => setArticleType(e.target.value)} required />
        </div>
        <div>
          <label>Gender:</label>
          <input type="text" value={gender} onChange={(e) => setGender(e.target.value)} required />
        </div>
        <div>
          <label>Machine Speed:</label>
          <input type="number" value={machineSpeed} onChange={(e) => setMachineSpeed(e.target.value)} required />
        </div>
        <div>
          <label>Designer Name:</label>
          <input type="text" value={designer} onChange={(e) => setDesigner(e.target.value)} required />
        </div>
        <div>
          <label>Grapher Name:</label>
          <input type="text" value={grapher} onChange={(e) => setGrapher(e.target.value)} required />
        </div>
        <div>
          <label>Master Name:</label>
          <input type="text" value={master} onChange={(e) => setMaster(e.target.value)} required />
        </div>
        <div>
          <label>Sample Status:</label>
          <input type="text" value={sampleStatus} onChange={(e) => setSampleStatus(e.target.value)} required />
        </div>
        <button type="submit">Submit</button>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
};

export default AddSampleDetails;
